import React, { } from 'react';
import classes from './SideBar.module.css'
export default function SideBar() {
    return(
       <nav className={`${classes.sidebar}`}>
           <header>
                <h2>Khaled Ashraf</h2>
           </header>
           <div className={`${classes.scrollbox}`}>
                <div className={`${classes.scrollboxInner}`}>
                    <p>lo</p>
                </div>
           </div>
       </nav>
    )
}
